// src/components/GoogleSheetData.js
import React, { useState, useEffect, useMemo } from 'react';
import axios from 'axios';
import SummaryTable from './SummaryTable';
import { fetchDataFromSheet } from '../utils/DataFetcher';
import { calculateWeeklySummary, calculateAllSummary } from '../utils/Calculations';
import './GoogleSheetData.css';

const GoogleSheetData = () => {
  const [summaryData, setSummaryData] = useState([]);
  const [weeklySummaryData, setWeeklySummaryData] = useState([]);
  const [allSummaryData, setAllSummaryData] = useState([]);
  const [dailyPachiraIncome, setDailyPachiraIncome] = useState([]);
  const [weeklyPachiraIncome, setWeeklyPachiraIncome] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [sortConfig, setSortConfig] = useState({ key: 'date', direction: 'ascending' });
  const [view, setView] = useState('daily');

  const sheetId = '1D2B33Uj1vS_weRZQAQdMRcaQbk1KG1SAjNfoaHAKrSo'; // Your Google Sheet ID
  const apiKey = 'AIzaSyBAPhvHyE-PbFUktWwlt-2_KJfwQTabEvQ'; // Your API Key

  // Memoize the tabNames array to prevent re-creation on each render
  const tabNames = useMemo(() => ['S1x', 'S2x', 'S3PM', 'S3IR', 'follow'], []);

  // Memoize the income tabNames array to prevent re-creation on each render
  const incomeTabNames = useMemo(() => ['Tennis', 'MLB', 'American Football'], []);

  useEffect(() => {
    const fetchAllData = async () => {
      try {
        // Fetch data from all tabs
        const tabDataResults = await fetchDataFromSheet(sheetId, apiKey, tabNames);
        const incomeDataResults = await fetchDataFromSheet(sheetId, apiKey, [...incomeTabNames, 'follow']);

        // Combine all data into a summary object
        const summary = {};
        const dailyIncomeSummary = {};

        tabDataResults.forEach(({ tabName, data, error }) => {
          if (data === null) {
            console.error(`No data received for ${tabName}. Error:`, error?.response ? error.response.data : error.message);
            return;
          }

          const tabData = data.values || [];

          if (tabData.length < 2) {
            console.warn(`No data found in tab ${tabName}`);
          } else {
            console.log(`Total rows in ${tabName}:`, tabData.length);
          }

          // Skip the header row and process each row
          tabData.slice(1).forEach((row, rowIndex) => {
            const date = row[0]; // Date column

            // Check if P/L and Turnover columns exist and have valid numbers
            if (row[8] !== undefined && row[5] !== undefined) {
              const plRaw = row[8].replace(/,/g, '').trim();
              const turnoverRaw = row[5].replace(/,/g, '').trim();
              const pl = parseFloat(plRaw);
              const turnover = parseFloat(turnoverRaw);

              if (!isNaN(pl) && !isNaN(turnover)) {
                if (!summary[date]) {
                  summary[date] = { date, TotalTurnover: 0 };
                }
                summary[date][tabName] = (summary[date][tabName] || 0) + pl;
                summary[date][`turnover_${tabName}`] = (summary[date][`turnover_${tabName}`] || 0) + turnover;
                summary[date].TotalTurnover += turnover;
              } else {
                console.warn(`Invalid P/L or Turnover value at row ${rowIndex + 1} for ${tabName} on ${date}:`, row[8], row[5]);
              }
            } else {
              console.warn(`Missing P/L or Turnover value at row ${rowIndex + 1} for ${tabName} on ${date}`);
            }
          });
        });

        // Process income data for Pachira Income views
        incomeDataResults.forEach(({ tabName, data, error }) => {
          if (data === null) {
            console.error(`No data received for ${tabName}. Error:`, error?.response ? error.response.data : error.message);
            return;
          }

          const tabData = data.values || [];

          if (tabData.length < 2) {
            console.warn(`No data found in tab ${tabName}`);
          }

          tabData.slice(1).forEach((row, rowIndex) => {
            const date = row[0]; // Date column
            const incomeRaw = tabName === 'follow' ? row[8] : row[10]; // Column I for "follow", Column K for other tabs
            const income = parseFloat(incomeRaw ? incomeRaw.replace(/,/g, '').trim() : 0);

            if (!isNaN(income)) {
              if (!dailyIncomeSummary[date]) {
                dailyIncomeSummary[date] = { date, Total: 0 };
              }
              dailyIncomeSummary[date][tabName] = (dailyIncomeSummary[date][tabName] || 0) + income;
              dailyIncomeSummary[date].Total += income;
            }
          });
        });

        const dailyIncomeArray = Object.values(dailyIncomeSummary);
        setDailyPachiraIncome(dailyIncomeArray);

        // Calculate weekly summary for income
        const weeklyIncomeSummary = calculateWeeklySummary(dailyIncomeArray, incomeTabNames);
        setWeeklyPachiraIncome(weeklyIncomeSummary);

        const summaryArray = Object.values(summary).map(entry => {
          const totalPL = tabNames.reduce((acc, tab) => acc + (entry[tab] || 0), 0);
          const totalTurnover = tabNames.reduce((acc, tab) => acc + (entry[`turnover_${tab}`] || 0), 0);
          return { ...entry, TotalPL: totalPL, TotalTurnover: totalTurnover };
        });

        setSummaryData(summaryArray);
        setWeeklySummaryData(calculateWeeklySummary(summaryArray, tabNames));
        setAllSummaryData(calculateAllSummary(summaryArray, tabNames));
      } catch (error) {
        setError('Error fetching data');
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchAllData();
  }, [apiKey, sheetId, tabNames, incomeTabNames]);

  const sortData = (key) => {
    let direction = 'ascending';
    if (sortConfig.key === key && sortConfig.direction === 'ascending') {
      direction = 'descending';
    }

    const dataToSort = view === 'daily' ? summaryData : view === 'weekly' ? weeklySummaryData : view === 'all' ? allSummaryData : view === 'dailyIncome' ? dailyPachiraIncome : weeklyPachiraIncome;

    const sortedData = [...dataToSort].sort((a, b) => {
      if (key === 'date' || key === 'weekStart') {
        return direction === 'ascending'
          ? new Date(a[key].split('/').reverse().join('-')) - new Date(b[key].split('/').reverse().join('-'))
          : new Date(b[key].split('/').reverse().join('-')) - new Date(a[key].split('/').reverse().join('-'));
      } else {
        const aValue = a[key] !== undefined ? a[key] : 0;
        const bValue = b[key] !== undefined ? b[key] : 0;
        return direction === 'ascending' ? aValue - bValue : bValue - aValue;
      }
    });

    if (view === 'daily') {
      setSummaryData(sortedData);
    } else if (view === 'weekly') {
      setWeeklySummaryData(sortedData);
    } else if (view === 'all') {
      setAllSummaryData(sortedData);
    } else if (view === 'dailyIncome') {
      setDailyPachiraIncome(sortedData);
    } else {
      setWeeklyPachiraIncome(sortedData);
    }

    setSortConfig({ key, direction });
  };

    if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div>
      <h1>Performance Summary</h1>
      <div>
        <button onClick={() => setView('daily')}>Daily Summary</button>
        <button onClick={() => setView('weekly')}>Weekly Summary</button>
        <button onClick={() => setView('all')}>All Summary</button>
        <button onClick={() => setView('dailyIncome')}>Daily Pachira Income</button>
        <button onClick={() => setView('weeklyIncome')}>Weekly Pachira Income</button>
      </div>
      {view === 'daily' ? (
        <>
          <h2>Daily Summary</h2>
          <SummaryTable
            data={summaryData}
            sortConfig={sortConfig}
            sortData={sortData}
            tabNames={tabNames}
            isWeekly={false}
            isAllSummary={false}
          />
        </>
      ) : view === 'weekly' ? (
        <>
          <h2>Weekly Summary</h2>
          <SummaryTable
            data={weeklySummaryData}
            sortConfig={sortConfig}
            sortData={sortData}
            tabNames={tabNames}
            isWeekly={true}
            isAllSummary={false}
          />
        </>
      ) : view === 'all' ? (
        <>
          <h2>All Summary</h2>
          <SummaryTable
            data={allSummaryData}
            sortConfig={sortConfig}
            sortData={sortData}
            tabNames={tabNames}
            isWeekly={false}
            isAllSummary={true}
          />
        </>
      ) : view === 'dailyIncome' ? (
        <>
          <h2>Daily Pachira Income</h2>
          <SummaryTable
            data={dailyPachiraIncome}
            sortConfig={sortConfig}
            sortData={sortData}
            tabNames={incomeTabNames}
            isWeekly={false}
            isAllSummary={false}
            isIncome={true} // Custom prop to identify this as an income view
          />
        </>
      ) : view === 'weeklyIncome' ? (
        <>
          <h2>Weekly Pachira Income</h2>
          <SummaryTable
            data={weeklyPachiraIncome}
            sortConfig={sortConfig}
            sortData={sortData}
            tabNames={incomeTabNames}
            isWeekly={true}
            isAllSummary={false}
            isIncome={true} // Custom prop to identify this as an income view
          />
        </>
      ) : null}
    </div>
  );
};

export default GoogleSheetData;
